import 'bootstrap/dist/css/bootstrap.css';
import './images/flipkartlogo'

export default function Header (){

    return(

        <>
        
        <header className='header'>
            <div className='container d-flex'>
            <img src={flipkartlogo}/>
            </div>
        </header>

        </>

    )
}
